void cbWorker(dyn_string dp, dyn_anytype val){

      sdShowValue(&quot;txt_sRegANr&quot;, dp[81], val[81], 1, &quot;1&quot;, 0, &quot;&quot;);
      setValue(&quot;current_card&quot;, &quot;text&quot;, val[82]);
      //TABLE2.updateLines(1,&quot;#1_l&quot;, val[3] , &quot;#2_l&quot;, val[4], &quot;#3_l&quot;,val[5],&quot;#4_l&quot;,val[6], &quot;#5_l&quot;, val[7], &quot;#6_l&quot;, val[8], &quot;#7_l&quot;,val[9], &quot;#8_l&quot;, val[10]);
//setValue (&quot;TABLE2&quot;, &quot;updateLines&quot;, 3, &quot;#1&quot;, val[3] , &quot;#2&quot;, val[4], &quot;#3&quot;,val[5],
  //            &quot;#4&quot;,val[6], &quot;#5&quot;, val[7], &quot;#6&quot;, val[8], &quot;#7&quot;,val[9], &quot;#8&quot;, val[10]);


      //license_plate.text = &quot;Гос. номер: &quot; + val[16];
     // sdShowValue(&quot;PercentPrisadki&quot;, dp[17], val[17], 1, &quot;1&quot;, 0, &quot;&quot;);
dyn_float temp, temp1;
 for(int i=1; i&lt;=10; i++){
    temp[i] = val[i*8-7]*val[i*8-6]/100;
    temp1[i] = val[i*8-7] - temp[i];
    TABLE2.cellValueRC(i-1, &quot;#1_l&quot;, dpValToString(dp[i*8-7], val[i*8-7]));
    TABLE2.cellValueRC(i-1, &quot;#2_l&quot;, dpValToString(dp[i*8-7], temp1[i]));
    TABLE2.cellValueRC(i-1, &quot;#3_l&quot;, dpValToString(dp[i*8-7], temp[i]));
    TABLE2.cellValueRC(i-1, &quot;#4_l&quot;, dpValToString(dp[i*8-4], val[i*8-4]));
    TABLE2.cellValueRC(i-1, &quot;#5_l&quot;, dpValToString(dp[i*8-3], val[i*8-3]));
    TABLE2.cellValueRC(i-1, &quot;#6_l&quot;, dpValToString(dp[i*8-2], val[i*8-2]));
    TABLE2.cellValueRC(i-1, &quot;#7_l&quot;, dpValToString(dp[i*8-1], val[i*8-1]));
    TABLE2.cellValueRC(i-1, &quot;#8_l&quot;, dpValToString(dp[i*8], val[i*8]));
    switch(val[i*8-5]){
     case &quot;АИ-92&quot;:
       setValue(&quot;COMBO_BOX&quot;+i, &quot;currentIndex&quot;, 1);
      //COMBO_BOX1.currentIndex = 1;
      break;
     case &quot;АИ-95&quot;:
      setValue(&quot;COMBO_BOX&quot;+i, &quot;currentIndex&quot;, 2);
      break;
     case &quot;АИ-98&quot;:
      setValue(&quot;COMBO_BOX&quot;+i, &quot;currentIndex&quot;, 3);
      break;
     case &quot;АИ-100&quot;:
      setValue(&quot;COMBO_BOX&quot;+i, &quot;currentIndex&quot;, 4);
      break;
     case &quot;ДТ&quot;:
      setValue(&quot;COMBO_BOX&quot;+i, &quot;currentIndex&quot;, 5);
      break;
     case &quot;ДТ(О)&quot;:
      setValue(&quot;COMBO_BOX&quot;+i, &quot;currentIndex&quot;, 6);
      break;
     case &quot;ДТ(G)&quot;:
      setValue(&quot;COMBO_BOX&quot;+i, &quot;currentIndex&quot;, 7);
      break;
     case &quot;G100&quot;:
      setValue(&quot;COMBO_BOX&quot;+i, &quot;currentIndex&quot;, 8);
      break;
     default:
      setValue(&quot;COMBO_BOX&quot;+i, &quot;currentIndex&quot;, 0);

    }
    TABLE3.cellValueRC(i-1, &quot;Num&quot;, i);

  }







}
